import React from "react";
import { useAuth } from ""

const NavProfile = () => {
    const { currentUser } = useAuth();
    return (
         <div className="dropdown">
            <div className="btn dropdown-toggle d-flex align-items-center">
            <div className="me-2">{currentUser.name}</div>
            </div>
         </div>
    );
};

export default NavProfile;
